import React from "react";
import phyo1 from "../images/profiles/phyo-headshot.png";
import { SocialIcon } from "react-social-icons";
import { Button } from "react-bootstrap";
const LeftLanding = () => {
  return (
    <div className="m-5 center">
      <div
        className="bg-white pt-1 mb-5 full-wid-hei"
        data-aos="flip-right"
      ></div>
      <img
        src={phyo1}
        data-aos="fade-right"
        className="custom-wid-hei profile"
      ></img>
      <div className="d-flex flex-row justify-content-center mt-5">
        <SocialIcon url="https://www.linkedin.com/in/phyo-khine/" />
        <SocialIcon url="https://github.com/phyogitty?tab=repositories" />
        <Button
          onPress={() =>
            Linking.openURL(
              "mailto:khine.t.phyo@gmail.com?subject=SendMail&body=Description"
            )
          }
          title="khine.t.phyo@gmail.com"
        >
          <SocialIcon url="https://email.com" />
        </Button>
      </div>
      <div
        className="bg-white pt-1 mt-5 full-wid-hei"
        data-aos="flip-right"
      ></div>

      <div className="p-4 mt-4" data-aos="flip-left">
        <h3>"This is someone'e quote that I like and I am gonna put"</h3>
        <h4>- Written by Someone</h4>
      </div>
      <div className="p-4" data-aos="flip-left">
        <h3>"This is someone'e quote that I like and I am gonna put"</h3>
        <h4>- Written by Someone</h4>
      </div>
    </div>
  );
};

export default LeftLanding;
